import React, { Component } from "react";
import { BootstrapTable, TableHeaderColumn } from "react-bootstrap-table";
import "../../node_modules/react-bootstrap-table/css/react-bootstrap-table.css";

class TablaMongo extends Component {
    render() {
        return (
            <div>
                <BootstrapTable data={this.props.datosTabla} height='500' scrollTop={'Bottom'} bordered={false}>
                    <TableHeaderColumn isKey dataField='name'> NAME </TableHeaderColumn>
                    <TableHeaderColumn dataField='location'> LOCATION </TableHeaderColumn>
                    <TableHeaderColumn dataField='age'> AGE </TableHeaderColumn>
                    <TableHeaderColumn dataField='infectedtype'> INFECTEDTYPE </TableHeaderColumn>
                    <TableHeaderColumn dataField='state'> STATE </TableHeaderColumn>
                </BootstrapTable>
            </div>
            //<div className="container"><p>hois</p></div>
        );
    }
}

export default TablaMongo;
